import { createTheme, ThemeProvider } from '@material-ui/core/styles';
import CustomBtn from './components/CustomBtn';
import './App.css';
import NavBar from './components/NavBar';
import SideBar from './components/SideBar';


const theme = createTheme({
  palette: {
    primary: {
      main: "#2e1667"
    },
    secondary: {
      main: "#c7d8ed"
    },
  },
  typography: {
    fontFamily: [
      'Arial'
    ],
    h4: {
      fontWeight: 600,
      fontSize: 28,
      lineHeight: '2rem'
    },
    h5: {
      fontWeight: 200,
      lineHeight: '2rem'
    }
  }
})
function App() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar/>
        <SideBar/>
      </ThemeProvider>
    </div>
  );
}

export default App;
